import './Footer.css';

export function Footer() {
    return (
        <footer id="contacts">
            <div>
                <h3>House staff</h3>
                <span>
                    Благодаря нам вы легко сможете оформить свой интерьер в
                    стиле джапанди
                </span>
            </div>
            <div>
                <h3>Служба заботы</h3>
                <div>Контактный телефон: +70367872376</div>
                <div>Наш email: housestaff@bk.ru</div>
            </div>
        </footer>
    );
}
